import React from "react";
import Box from "./Box";

function Room(props) {
 return (
   <div className="room">
    <h2>room{props.roomId}</h2>
     <Box 
        img = "/img/temp.png"
        name = "temp"
        data = {props.temp}
     />
     <Box 
        img = "/img/water-drop.png"
        name = "hub"
        data = {props.hub}
     />
      <Box 
        img = "/img/future.png"
        name = "hub"
        data = {props.last}
     />
      <Box 
        img = "/img/future.png"
        name = "hub"
        data = {props.hub}
     />
   </div> );}
export default Room;
